INSERT INTO `v1_b14c03a51b9f17919ac8a928a029ffe76b7fe4b6f39735d36453582997bff871` VALUES ("", "", "", "", 34314, 21, "vo_wac_34314", 0, "vo_wac_34314_002", 0, 34314080);
